column8:
シャワー型マイクロバブル発生器「ベスティソーダスパ」用の重炭酸タブレットです。マイクロバブルでお肌の奥の汚れを綺麗にスッキリ。お湯に溶けだした重炭酸が髪やお肌を優しく洗い上げます。そのままバスタブに入れ入浴剤としてもご使用いただけます。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">シャワー型マイクロバブル発生器「ベスティソーダスパ」用の重炭酸タブレットです。マイクロバブルでお肌の奥の汚れを綺麗にスッキリ。お湯に溶けだした重炭酸が髪やお肌を優しく洗い上げます。そのままバスタブに入れ入浴剤としてもご使用いただけます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">商品区分</font></td><td width="75%" align="left"><font color="#333333" size="-1">化粧品</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：6×11×20cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：160g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">炭酸水素Na、炭酸Na、クエン酸、コハク酸、PEG-150、ラウロイルグルタミン酸Na、水</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">ジップパウチ袋入り</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">15g×10錠セット</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
