■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>スタイリッシュで気持ちいい浴び心地を追及したシャワーヘッド!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5407/1055712-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【日本国内取付可能メーカー】<br>TOTO、LIXIL(INAX)、カクダイ、YUKO、三栄水栓(SAN-EI)、ノーリツ・ミズタニ、タカギ、TBC、大阪ガス一部製品<br>【付属アダプターが必要な日本国内取付可能メーカー】<br>KVK(Kアダプター)、ガスター(Gアダプター)<br><br>※海外メーカーのシャワーホースはネジサイズG1/2規格により、取付可能です。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="600" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5407/1055712-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">シャワー本来の浴び心地を追及することで気持ち良く浴びることができる仕上がりとなりました。散水板が根詰まりをした場合に突起部を撫でていただくことで解決するエラストマーを採用。さらに、機能性を外した事でコストカットを実現し、機能・値段ともにお客様の満足できるシャワーヘッドとなりました。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">シャワー本来の浴び心地を追及することで気持ち良く浴びることができる仕上がりとなりました。散水板が根詰まりをした場合に突起部を撫でていただくことで解決するエラストマーを採用。さらに、機能性を外した事でコストカットを実現し、機能・値段ともにお客様の満足できるシャワーヘッドとなりました。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">4×7.8×26cm</font><br><font color="#333333" size="-1">個装サイズ：5×13×30cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">103g</font><br><font color="#333333" size="-1">個装重量：220g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">本体:ABS樹脂(クロームメッキ加工)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">シャワーホース用アダプタ2型<br>Oリングパッキン</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
